import random

class Case:
    """Définit une case du labyrinthe par :
        - Le caractère la définissant :
            # : un mur
            . : sol vide
            ~ : de l'eau
        - Sa position
    """
    def __init__(self,X,Y,car):
        self.car = car          # le caractère de la case
        self.posx = X
        self.posy = Y
    def __repr__(self):
        #return "la case est un :{0} en ({1},{2})".format(self.car, self.posx, self.posy)
        return(self.car)


class Laby:
    """Le labyrinthe contenant les cases. Le construire va demander
    du boulot!
    """

    def __init__(self, sx,sy, ex,ey, depart, arrivee):
        """ notre labyrinthe va de sx, sy
        à ex, ey.
        La case de départ est un tuple depart
        La case d'arrivée est un tuple arrivee
        """
        self.longY = ey - sy                               # Dimensions du labyrinthe
        self.longX = ex - sx 
        self._l = []         

        #self._l = [ Case(j,i,"#") for j in range(self.longX) for i in range(self.longY)]
        self._l = []         

        # On crée les cases
        for i in range(self.longY):
            for j in range(self.longX):
                self._l.append(Case(j,i,"#"))           # on crée une colonne

        self.arrivee = arrivee
        self.depart = depart

    def _get_pos(self, X, Y):
        """ Méthode pour accéder à une case du laby placée
         en X et Y du plateau
         Cela retourne donc un objet de type Case
         Les cases sont numérotées de 0 à longX-1*longY-1
        """
        if (X >= 0) and (X < self.longX) and (Y >= 0) and (Y < self.longY):
            indice = (X  + Y *self.longX)
            return self._l[indice]
        else :
            raise BaseException

    def _get_laby(self):
        return self._l

    def estcreusable(self, X, Y):
        """ On vérifie si la case a 3 voisines non creusées
            retourne True ou False
        """
        nbMur = 4
        
        if self._get_pos(X,Y).car == '#':       # Si la case est un mur
            try:                                # on regarde dans chaque direction, si c'est pas un mur on
                                                # fait décroitre nbMur
                                                # Si cette case n'existe pas, alors c'est comme un mur (limites)
                if self._get_pos(X + 1,Y).car != "#":
                    nbMur -= 1
            except:
                pass
            try:
                if self._get_pos(X - 1,Y).car != "#" :
                    nbMur -=1
            except:
                pass
            try:
                if self._get_pos(X,Y+1).car != "#" :
                    nbMur -= 1
            except:
                pass
            try:
                if self._get_pos(X,Y-1).car != "#" :
                    nbMur -= 1
            except:
                pass
               
            if nbMur >= 3 :
                return True
            else:
                return False
        else : 
            return False

    def creuseCase(self,alX,alY):
        """ Sert à ouvrir au hasard le mur de la case
        de coordonnées alX et alY
        retourne la case ouverte
        """

        case = self._get_pos(alX, alY)
		# Direction au hasard
        possibilite = ["N","E","S","O"]
        c = 0
        while c != 1:
            if len(possibilite) > 0:
                # On choisi une direcion au hasard
                di = random.choice(possibilite)
                if di == "N":
                    nalX, nalY = alX, alY + 1
                elif di == "S":
                    nalX, nalY = alX, alY - 1
                elif di  == "E":
                    nalX, nalY = alX + 1, alY 
                elif di == "O":
                    nalX, nalY = alX - 1, alY 

                try:
                    # On regarde la case suivante, si erreur, c'est qu'elle n'existe pas
                    ncase = self._get_pos(nalX, nalY)
                    if self.estcreusable(nalX, nalY):
                        possibilite = ["N","E","S","O"]
                        c = 1
                    else:
                        possibilite.remove(di)
                except : # la case suivante n'existe pas
                    possibilite.remove(di)
            else:
                # on recule d'une case
                return 0

        # ouverture de la case
        ncase.car = "."
        return ncase            # On retourne la case ouverte

    def construire(self):
        """On va construire notre labyrinthe.
        L'algorithme est le suivant : 
            On prend une case au hasard,
            on prend une direction au hasard
            On vérifie que la case suivante existe
            on regarde si la case suivante a au moins 3 cases fermées à coté
            si oui on l'ouvre et enregistre sa position
            Si non, on prend un autre direction
            si plus de direction, on recule d'une case
            On s'arrête lorsque l'on est revenu au départ (registre vide)"""
        
        
        registre = []           # Liste des cases ouvertes. La dernière valeur est la case courante

        # On ouvre la case de départ 
        caseDep = self._get_pos(self.depart[0], self.depart[1])
        caseDep.car = "."
        registre.append(caseDep)

        # On ouvre les autres cases
        while len(registre) > 0:
            curcase = registre[len(registre) - 1]
            res = self.creuseCase(curcase.posx,curcase.posy)
            if res == 0:    # On recule d'une case
                registre.pop()
            else:           # On ajoute la case au registre 
                registre.append(res)
            
        # On ouvre la dernière case
        caseArrivee = self._get_pos(self.arrivee[0], self.arrivee[1])
        caseArrivee.car = "."
